import React from 'react';
import './Home.css';
import Header from '../Attributes/Header/Header';
import Viewpoints from '../Attributes/Viewpoints/Viewpoints';

function Home() {
    return (
        <div>
            <div className="container">
                <div className="Header">
                    <Header />
                </div>
                <div className="Viewpoints">
                    <Viewpoints />
                </div>
            </div>        
        </div>
    );
}

export default Attributes;
